  \"2015-12-20T21:54:45.128260\",\n\t\"name\": \"chemical-and-isotopic-tracers-from-the-arctic-ocean-nodc-accession-0068667\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data are water column and sediment
  data largely collected in the Bering and Chukchi Seas, with some coverage for the
  Beaufort and East Siberian Seas, and with limited coverage for other portions of
  the Arctic Ocean. Data include that collected on Alpha Helix cruises 139, 165, 166,
  174,189, 190, 214, and 224 between 1990 and 1999. Other data were obtained from
  cruises of the RV OKEAN (1993), USCGC Polar Star (1993), Mendeleev(1993), USCGC
  Polar Sea (2000), U.S. Canada Arctic Ocean Section(1994), and Polarstern (1993).
  Water column data include coverage from some to most stations on these cruises,
  and include bottle salinity, temperature, sigma-t, oxygen-18/16 ratios, phosphate,
  ammonia, silicate, nitrate, dissolved oxygen, iodine-129 concentrations, and chlorophyll
  a. Sediment data include plutonium and neptunium concentrations, including isotope
  data. Biological data include radionuclide burdens in marine mammal tissues donated
  by subsistence hunters on the North Slope of Alaska and in the Resolute region of
  Canada.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
